import React from 'react';
import styles from 'Homes.css';

const Homes1 = () => {
  return (
    <div>
      <div className={styles.text}>
        <div class="container">
          <div class="row">
            <div class="col-3">Customs Clearance & Drawback</div>
            <div class="col-3">Consultation</div>
            <div class="col-3">Education</div>
            <div class="col-3">About-Aone</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Homes1;
